import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';
import './App.css';

class App extends Component {
  state =  {
    user: null,
    orders: []
  }
  render() {

    return (
      <div>
        {this.state}
    <Login/>
 <Router>
 <div>
        <NavBar/>


      <Route exact path="/pizza" container={PizzaSlap} />


  </div>


  </Router>
  </div>
    )
  }
};

export default App;
